drop table TEMP_UnidadOrganizacional cascade constraints;
DROP SEQUENCE UNIDADORG_SEQ;
create table TEMP_UnidadOrganizacional (id number(19,0) not null, nombre varchar2(255 char) not null, comunidad varchar2(5 char) not null, provincia varchar2(5 char) not null, localidad varchar2(255 char) not null, primary key (id));
CREATE SEQUENCE UNIDADORG_SEQ
  START WITH 1
  MAXVALUE 999999999999999999999999999
  MINVALUE 1
  NOCYCLE
  NOCACHE
  NOORDER;

drop table TEMP_Organismo cascade constraints;
DROP SEQUENCE ORGANISMO_SEQ;
create table TEMP_Organismo (id number(19,0) not null, nombre varchar2(255 char) not null, rol varchar2(25 char), organismoPadre number(19,0), primary key (id));
CREATE SEQUENCE ORGANISMO_SEQ
  START WITH 1
  MAXVALUE 999999999999999999999999999
  MINVALUE 1
  NOCYCLE
  NOCACHE
  NOORDER;

DROP TABLE TEMP_Localidades cascade constraints;
CREATE TABLE TEMP_Localidades (
	ID	VARCHAR2(5) NOT NULL,
	CODPROVINCIA	VARCHAR2(2) NOT NULL,
	DESCRIPCION	VARCHAR2(75) NOT NULL,
	CONSTRAINT PK_TEMP_Localidades PRIMARY KEY (ID )
);
commit;

CREATE INDEX IDX_TEMP_Localidades ON TEMP_Localidades(CODPROVINCIA);

